// Helper to map agent email/name to agent ID
const getAgentIdFromEmailOrName = (email, name) => {
  if (email) {
    const agent = mockAgents.find(a => a.email && a.email.toLowerCase() === email.toLowerCase());
    if (agent) return agent.id;
  }
  if (name) {
    // Try to find a partial match if full name isn't available from raw data parsing
    const agent = mockAgents.find(a => a.name.toLowerCase().includes(name.toLowerCase()) || name.toLowerCase().includes(a.name.toLowerCase()));
    if (agent) return agent.id;
  }
  // Fallback: If agent is not in mockAgents, but we have name/email, create a temp ID
  // This helps in showing data even for agents not pre-defined in mockAgents
  const fallbackId = (email || name || 'unknown-agent').replace(/[^a-z0-9]/gi, '').toLowerCase();
  // console.warn(`Agent "${name}" (${email}) not found in mockAgents. Using fallback ID: ${fallbackId}`);
  return fallbackId;
};

