    numNBs: 15, // Number of New Business policies
    endorsementCorpFee: 50, // Endorsement Corporate Fee
    referralsPaidOut: 100, // Referrals Paid Out
    renewalReinstatementFees: 400, // Total Renewal and Reinstatement fees
    scanningViolations: 25, // Amount of scanning violations for the week (from commission sheet's total)
    arFees: 10, // Amount of AR fees for the week (from commission sheet's total)
  },
  {
    id: 'week2-agent1',
    agentId: 'agent1',
    agentName: 'Alice Smith',
    email: 'alice@example.com',
