    renewalReinstatementFees: 600,
    scanningViolations: 0,
    arFees: 0,
  },
  {
    id: 'week3-agent1',
    agentId: 'agent1',
    agentName: 'Alice Smith',
    email: 'alice@example.com',
    weekOf: '2024-06-17',
    totalNbBFFee: 100, // Low revenue to test qualification
    endoFees: 50,
