    numNBs: 2,
    endorsementCorpFee: 10,
    referralsPaidOut: 10,
    renewalReinstatementFees: 20,
    scanningViolations: 5,
    arFees: 2,
  },
  {
    id: 'week1-agent2',
    agentId: 'agent2',
    agentName: 'Bob Johnson',
    email: 'bob@example.com',
    weekOf: '2024-06-03',
    totalNbBFFee: 900,
    endoFees: 200,
    grossPayMade: 600,
    numNBs: 10,
    endorsementCorpFee: 40,
    referralsPaidOut: 50,
    renewalReinstatementFees: 300,
    scanningViolations: 0,
    arFees: 5,
  },
  {
    id: 'week1-agent3',
    agentId: 'agent3',
    agentName: 'Charlie Brown',
    email: 'charlie@example.com',
    weekOf: '2024-06-03',
    totalNbBFFee: 3000,
    endoFees: 600,
    grossPayMade: 1500,
    numNBs: 20, // Qualifies for 12.5% based on NBs and high revenue
    endorsementCorpFee: 100,
    referralsPaidOut: 200,
    renewalReinstatementFees: 800,
    scanningViolations: 0,
    arFees: 0,
  },
  {
    id: 'week1-agent4',
    agentId: 'agent4',
    agentName: 'Diana Prince',
    email: 'diana@example.com',
    weekOf: '2024-06-03',
    totalNbBFFee: 500,
    endoFees: 100,
    grossPayMade: 200,
    numNBs: 16, // Does not qualify for 12.5% due to NBs < 17
    endorsementCorpFee: 20,
    referralsPaidOut: 30,
    renewalReinstatementFees: 100,
    scanningViolations: 10, // Has violations
    arFees: 5, // Has AR fees
  },
];

// --- Mock Agent Credentials (expanded with more agents for the AR/SV data) ---
const mockAgents = [
  { id: 'agent1', name: 'Alice Smith', email: 'alice@example.com', password: 'password123' },
  { id: 'agent2', name: 'Bob Johnson', email: 'bob@example.com', password: 'password123' },
  { id: 'agent3', name: 'Charlie Brown', email: 'charlie@example.com', password: 'password123' },
  { id: 'agent4', name: 'Diana Prince', email: 'diana@example.com', password: 'password123' },
  // Adding more agents based on the provided raw data for AR/SV
  { id: 'aaron_s', name: 'Aaron Serrano', email: 'aaron.serrano@fiestainsurance.com', password: 'password123' },
  { id: 'alejandra_m', name: 'Alejandra Elizabeth Mancilla', email: 'alejandra.mancilla@fiestainsurance.com', password: 'password123' },
