  { id: 'araceli_r', name: 'Araceli Ramirez', email: 'A.ramirez@fiestainsurance.com', password: 'password123' },
  { id: 'brian_c', name: 'Brian Calderon', email: 'brian.calderon@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'chanel_m', name: 'CHANEL MORANDO', email: 'chanel.morando@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'cinthia_r', name: 'Cinthia Rincon', email: 'cinthia.rincon@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'dallana_d', name: 'DALLANA DIAZ', email: 'dallana.diaz@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'david_s_h', name: 'David Saldivar Hernandez', email: 'dhernandez@fiestainsurance.com', password: 'password123' },
  { id: 'diana_a', name: 'Diana Andrade', email: 'diana.andrade@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'dianna_m', name: 'Dianna Miranda', email: 'DIANNA.MIRANDA@FIESTAINSURANCE.COM', password: 'password123' },
  { id: 'eduardo_m', name: 'Eduardo Magdaleno', email: 'emagdaleno@fiestainsurance.com', password: 'password123' },
  { id: 'edwin_a_g', name: 'Edwin Alexander Gochez', email: 'Edwin.gochez@fiestainsurance.com', password: 'password123' },
  { id: 'elvira_v', name: 'Elvira Valencia', email: 'elvira.valencia@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'esmeralda_m', name: 'Esmeralda Mendoza', email: 'esmeralda.mendoza@fiestainsurance.com', password: 'password123' },
  { id: 'estrella_v', name: 'Estrella Venancio', email: 'estrella.venancio@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'fernando_m', name: 'Fernando Mora', email: 'fernando.mora@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'gonzalo_g', name: 'GONZALO GONZALEZ', email: 'gonzalo.gonzalez@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'henessie_b', name: 'Henessie Bautista', email: 'henessie.bautista@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'iridian_p', name: 'Iridian Preciado', email: 'iridian.preciado@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'jeannette_l', name: 'Jeannette Luna', email: 'jluna@fiestainsurance.com', password: 'password123' },
  { id: 'jose_c', name: 'Jose Capi', email: 'jose.capi@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'maria_a_m_v', name: 'MARIA AIDE MEDINA VILLALVA', email: 'MMEDINA@FIESTAINSURANCE.COM', password: 'password123' },
  { id: 'maria_r', name: 'Maria Resendez', email: 'maria.resendez@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'mariel_m', name: 'Mariel Macias', email: 'mariel.macias@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'marlen_d', name: 'Marlen Duran', email: 'marlen.duran@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'miguel_c_r', name: 'Miguel Carrasco Rodriguez', email: 'miguel.carrasco@fiestainsurance.com', password: 'password123' },
  { id: 'monique_j', name: 'MONIQUE JIMENEZ', email: 'monique.jimenez@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'myra_g', name: 'MYRA GONZALEZ', email: 'mgonzalez@fiestainsurance.com', password: 'password123' },
  { id: 'natalie_s', name: 'Natalie Serrano', email: 'natalie.serrano@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'nesli_p', name: 'Nesli Perez', email: 'Nesli.perez@fiestainsurance.com', password: 'password123' },
  { id: 'olimpia_m_v', name: 'Olimpia Mijares Vitlela', email: 'omijares@fiestainsurance.com', password: 'password123' },
  { id: 'patricia_g_m_p', name: 'Patricia G Martinez Pacheco', email: 'patrica.martinez@fiestainsurance.com', password: 'password123' },
  { id: 'patsy_m_d_c', name: 'PATSY MARTIN DEL CAMPO', email: 'patsy.martin@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
  { id: 'sandra_l', name: 'Sandra Leon', email: 'SANDRA.LEON@FIESTAINSURANCE.COM', password: 'password123' },
  { id: 'sanjuanita_p', name: 'SanJuanita Perez', email: 'SANJUANITA.PEREZ@FIESTAINSURANCE.COM', password: 'password123' },
  { id: 'usiel_m', name: 'USIEL MORA', email: 'usiel.mora@fiestainsurance.com', password: 'password123' }, // Fictional email for mock
];

// Helper to map agent email/name to agent ID
const getAgentIdFromEmailOrName = (email, name) => {
  if (email) {
    const agent = mockAgents.find(a => a.email && a.email.toLowerCase() === email.toLowerCase());
    if (agent) return agent.id;
  }
  if (name) {
    // Try to find a partial match if full name isn't available from raw data parsing
    const agent = mockAgents.find(a => a.name.toLowerCase().includes(name.toLowerCase()) || name.toLowerCase().includes(a.name.toLowerCase()));
    if (agent) return agent.id;
  }
  // Fallback: If agent is not in mockAgents, but we have name/email, create a temp ID
  // This helps in showing data even for agents not pre-defined in mockAgents
  const fallbackId = (email || name || 'unknown-agent').replace(/[^a-z0-9]/gi, '').toLowerCase();
  // console.warn(`Agent "${name}" (${email}) not found in mockAgents. Using fallback ID: ${fallbackId}`);
  return fallbackId;
};


// --- Parsing Raw Violation/AR Data ---
// This parsing function is designed to handle the highly unstructured raw data.
// It uses a heuristic approach based on common patterns in your data.
// For production use, converting your Google Sheet to a proper CSV or JSON would be far more reliable.
const parseRawViolationARData = (rawDataString, agents) => {
  const lines = rawDataString.trim().split('\n');
  const parsedRecords = [];
  let recordIdCounter = 0;

  // Create a mapping from agent email/name to agent ID for efficient lookup
  const agentMap = new Map();
  agents.forEach(agent => {
    if (agent.email) agentMap.set(agent.email.toLowerCase(), agent.id);
    if (agent.name) agentMap.set(agent.name.toLowerCase(), agent.id);
  });

  const getAgentIdInternal = (email, name) => {
    if (email) {
      const id = agentMap.get(email.toLowerCase());
      if (id) return id;
    }
    if (name) {
      const id = agentMap.get(name.toLowerCase());
      if (id) return id;
    }
    return null;
  };


  // Loop through lines, skipping the header (first line)
  for (let i = 1; i < lines.length; i++) {
    const line = lines[i].trim();
    if (!line) continue;

    let currentLine = line;
    let agentName = "";
    let agentEmail = "";

    // 1. Extract Agent Name and Email (most challenging part due to variable spacing)
    // Try to find the email pattern first, as it's more distinct
    const emailRegex = /([a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,4})/i;
    const emailMatch = currentLine.match(emailRegex);

    if (emailMatch) {
      agentEmail = emailMatch[1];
      const emailIndex = currentLine.indexOf(agentEmail);
      agentName = currentLine.substring(0, emailIndex).trim();
      currentLine = currentLine.substring(emailIndex + agentEmail.length).trim();
    } else {
      // If no email, try to guess the agent name based on common patterns
      // Heuristic: Agent name is usually at the very beginning before the first date/ID/money pattern
      const firstNonNameCharIndex = currentLine.search(/\d{2}\/\d{1,2}-\d{1,2}\/\d{1,2}/) || currentLine.search(/\b\d{8,}\b/) || currentLine.search(/\$[\d.,]+\.?\d*/);
      if (firstNonNameCharIndex !== -1) {
        agentName = currentLine.substring(0, firstNonNameCharIndex).trim();
        currentLine = currentLine.substring(firstNonNameCharIndex).trim();
      } else {
        agentName = currentLine.trim(); // Take the whole line as name if no other pattern
        currentLine = "";
      }
    }

    const agentId = getAgentIdInternal(agentEmail, agentName);
    // If agent ID is still null, it means we couldn't match. Generate a temporary ID or skip.
    const finalAgentId = agentId || getAgentIdFromEmailOrName(agentEmail, agentName); // Use the global fallback

    if (!finalAgentId) {
      // console.warn(`Skipping line due to unidentifiable agent: ${line}`);
      continue;
    }


    // 2. Parse AR and SV data within the remaining `currentLine`
    const datePattern = /\d{2}\/\d{1,2}-\d{1,2}\/\d{1,2}/; // e.g., 06/9-6/15
    const amountPattern = /\$[\d.,]+\.?\d*/; // e.g., $10.00, $25.00
    const customerIdPattern = /\b\d{8,}\b/; // e.g., 12345678, 174437853 (word boundary for robustness)

    // Split the remaining line into potential blocks using date patterns as anchors
    // This is the most effective way to separate AR and SV blocks given the raw format.
    const blockParts = currentLine.split(new RegExp(`(${datePattern.source})`)).filter(Boolean).map(s => s.trim());

    let arBlockText = "";
    let svBlockText = "";

    // Heuristic: first date block is AR, second is SV
    let currentDataBuffer = [];
    let foundFirstDate = false;
    for (const part of blockParts) {
      if (datePattern.test(part)) {
        if (!foundFirstDate) {
          arBlockText = currentDataBuffer.join(' ') + ' ' + part;
          currentDataBuffer = [];
          foundFirstDate = true;
        } else {
          svBlockText = currentDataBuffer.join(' ') + ' ' + part;
          currentDataBuffer = [];
        }
      } else {
        currentDataBuffer.push(part);
      }
    }
    // Append any remaining buffer to the last determined block
    if (foundFirstDate) {
        svBlockText += ' ' + currentDataBuffer.join(' ');
    } else {
        arBlockText += ' ' + currentDataBuffer.join(' ');
    }

    // Function to parse an individual AR or SV data block
    const parseSubBlock = (blockText, type) => {
      if (!blockText || blockText.trim() === '') return null;

      let week = blockText.match(datePattern)?.[0] || 'N/A';
      let remaining = blockText.replace(week, '').trim();

      const amountMatch = remaining.match(amountPattern);
      if (!amountMatch) return null; // No amount, no record

      const amountStr = amountMatch[0];
      const amount = parseFloat(amountStr.replace('$', '').replace(',', '')) || 0;

      const amountIndex = remaining.indexOf(amountStr);
      let beforeAmount = remaining.substring(0, amountIndex).trim();
      let afterAmount = remaining.substring(amountIndex + amountStr.length).trim();

      const customerId = beforeAmount.match(customerIdPattern)?.[0] || 'N/A';
      const customerName = beforeAmount.replace(customerIdPattern, '').trim() || 'N/A';
      const details = afterAmount || 'N/A';

      return {
        id: `${type}-${finalAgentId}-${recordIdCounter++}`,
        agentId: finalAgentId,
        agentName: agentName, // Use parsed agent name
        email: agentEmail,   // Use parsed agent email
        weekOf: week,
        type: type,
        customerId: customerId,
        customerName: customerName,
        amount: amount,
        details: details,
      };
    };

    const arRecord = parseSubBlock(arBlockText, 'AR');
    if (arRecord) parsedRecords.push(arRecord);

    const svRecord = parseSubBlock(svBlockText, 'SV');
    if (svRecord) parsedRecords.push(svRecord);
  }

  return parsedRecords;
};

