// --- Commission Calculation Function ---
const calculateCommission = (weeklyData) => {
  // Ensure all necessary fields exist and default to 0 if not present
  const totalNbBFFee = weeklyData.totalNbBFFee || 0;
  const endoFees = weeklyData.endoFees || 0;
  const grossPayMade = weeklyData.grossPayMade || 0;
  const numNBs = weeklyData.numNBs || 0;
  const endorsementCorpFee = weeklyData.endorsementCorpFee || 0;
  const referralsPaidOut = weeklyData.referralsPaidOut || 0;
  const renewalReinstatementFees = weeklyData.renewalReinstatementFees || 0;
  // scanningViolations and arFees from the weekly commission sheet are already used here
  const scanningViolations = weeklyData.scanningViolations || 0;
  const arFees = weeklyData.arFees || 0;

  // 1. Calculate Total NB + Endo Fees (before deductions)
  const totalNbEndoFeesBeforeDeductions = totalNbBFFee + endoFees;

  // 2. Deduct from Total NB + Endo Fees for intermediate revenue calculation
  // This is used for the $500 qualification and combined revenue.
  const nbEndoAfterDeductions = totalNbEndoFeesBeforeDeductions - endorsementCorpFee - referralsPaidOut;

  // 3. Calculate Renewal/Reinstatement contribution (20% deducted)
  const renewalAfterDeduction = renewalReinstatementFees * 0.80;

  // 4. Combine NB+Endo after deductions and Renewal/Reinstatement contribution
  // This is the total qualifying revenue for commission calculation
  const totalQualifyingRevenue = nbEndoAfterDeductions + renewalAfterDeduction;

  // 5. Calculate Remaining Total Revenue (Net Revenue)
  // "Remaining total revenue after gross pay, NB fees, Endorsement fees and payouts are deducted from the total NB+Endo fees."
  // Interpretation: (Total NB+Endo Fees BEFORE deductions) - Gross Pay - Endorsement Corp Fee - Referrals Paid Out
  const remainingTotalRevenue = totalNbEndoFeesBeforeDeductions - grossPayMade - endorsementCorpFee - referralsPaidOut;

  let finalCommission = 0;
  let commissionRate = 0;
  let qualifiedForCommission = false;

  // 6. Commission Qualification: Total qualifying revenue must be over $500
  if (totalQualifyingRevenue > 500) {
    qualifiedForCommission = true;

    // 7. Determine Commission Percentage
    // 12.5% if >= 17 NBs AND > $3500 NB + Endo revenue (before deductions)
    if (numNBs >= 17 && totalNbEndoFeesBeforeDeductions > 3500) {
      commissionRate = 0.125; // 12.5%
    } else {
      commissionRate = 0.10; // 10%
    }

    // Calculate base commission
    finalCommission = totalQualifyingRevenue * commissionRate;

    // 8. Deduct Scanning Violations and AR Fees from final commission
    finalCommission = finalCommission - scanningViolations - arFees;

    // Ensure commission doesn't go below zero
    finalCommission = Math.max(0, finalCommission);
  }

  return {
    ...weeklyData, // Include all original weekly data
    totalNbEndoFeesBeforeDeductions: totalNbEndoFeesBeforeDeductions,
    nbEndoAfterDeductions: nbEndoAfterDeductions,
    renewalAfterDeduction: renewalAfterDeduction,
    totalQualifyingRevenue: totalQualifyingRevenue,
    remainingTotalRevenue: remainingTotalRevenue,
    qualifiedForCommission: qualifiedForCommission,
    commissionRate: qualifiedForCommission ? (commissionRate * 100).toFixed(1) + '%' : 'N/A', // Format as percentage string
    finalCommission: qualifiedForCommission ? finalCommission : 0, // Ensure 0 if not qualified
  };
};

