          </form>
          <p className="mt-4 text-center text-sm text-gray-500">
            Hint: Try Agent ID 'agent1' with password 'password123', or 'alejandra_m' with 'password123' to see AR/SV data.
          </p>
        </CardContent>
      </Card>
