  );
};


// --- Main App Component ---
function App() {
  const [currentPage, setCurrentPage] = useState('commission'); // Default to 'commission' now
  const [loggedInAgentId, setLoggedInAgentId] = useState(null);
  const [loggedInAgentName, setLoggedInAgentName] = useState(null);
  const [loginError, setLoginError] = useState('');

  const handleLogin = (agentId, password) => {
    const agent = mockAgents.find(a => a.id === agentId && a.password === password);
    if (agent) {
      setLoggedInAgentId(agent.id);
      setLoggedInAgentName(agent.name);
      setLoginError('');
      setCurrentPage('commission'); // Redirect to commission report after login
    } else {
      setLoginError('Invalid Agent ID or password.');
    }
  };

  const handleLogout = () => {
    setLoggedInAgentId(null);
    setLoggedInAgentName(null);
    setLoginError('');
    setCurrentPage('commission'); // Go back to login or default page after logout
  };

  // Filter data based on the logged-in agent
  const filteredWeeklyCommissionData = loggedInAgentId
    ? mockWeeklyCommissionData.filter(p => p.agentId === loggedInAgentId)
    : [];

  const filteredViolationAndARData = loggedInAgentId
    ? mockViolationAndARData.filter(item => item.agentId === loggedInAgentId)
    : [];

  return (
    <div className="min-h-screen bg-gray-50 font-inter text-gray-900 antialiased">
      {/* Global Styles (Inter font and basic layout) */}
      <style>
        {`
          @import url('https://fonts.googleapis.com/css2?family=Inter:wght@400;500;600;700&display=swap');
          body {
            font-family: 'Inter', sans-serif;
            margin: 0;
            padding: 0;
            box-sizing: border-box;
          }
          /* Basic shadcn-like colors and shadows */
          .bg-card { background-color: #ffffff; }
          .text-card-foreground { color: #0f172a; } /* slate-900 */
          .border { border: 1px solid #e2e8f0; } /* slate-200 */
          .shadow { box-shadow: 0 1px 3px 0 rgba(0, 0, 0, 0.1), 0 1px 2px 0 rgba(0, 0, 0, 0.06); }
          .shadow-sm { box-shadow: 0 1px 2px 0 rgba(0, 0, 0, 0.05); }
          .text-muted-foreground { color: #64748b; } /* slate-500 */
          .hover\\:bg-muted\\/50:hover { background-color: rgba(248, 250, 252, 0.5); } /* slate-50 with opacity */
          .data-\\[state\\=selected\\]\\:bg-muted[data-state="selected"] { background-color: #f8fafc; } /* slate-50 */
          .text-destructive { color: #ef4444; } /* red-500 */
          .text-primary { color: #10b981; } /* emerald-500 */
          .bg-primary { background-color: #10b981; } /* emerald-500 */
          .hover\\:bg-primary\\/90:hover { background-color: #059669; } /* emerald-600 */
        `}
      </style>

      {!loggedInAgentId ? (
        <Login onLogin={handleLogin} error={loginError} />
      ) : (
        <div className="flex flex-col md:flex-row h-full">
          {/* Sidebar Navigation */}
          <aside className="w-full md:w-64 bg-gray-800 text-white p-6 shadow-lg rounded-br-xl rounded-bl-xl md:rounded-bl-none md:rounded-tr-xl flex flex-row md:flex-col justify-center md:justify-start items-center md:items-stretch space-x-4 md:space-x-0 md:space-y-4">
            <h1 className="text-3xl font-extrabold mb-6 hidden md:block text-center">Agent Hub</h1>
            <p className="text-sm font-medium text-gray-300 mb-4 text-center hidden md:block">
                Logged in as: <span className="font-semibold text-white">{loggedInAgentName}</span>
            </p>
            <button
              onClick={() => setCurrentPage('commission')}
              className={`flex items-center space-x-3 px-4 py-2 rounded-lg transition-all duration-200 ${
                currentPage === 'commission' ? 'bg-indigo-600 shadow-md' : 'hover:bg-gray-700'
              }`}
            >
              <LayoutDashboard className="h-6 w-6" />
              <span className="font-medium">Weekly Commission</span>
            </button>
            <button
              onClick={() => setCurrentPage('violations')}
              className={`flex items-center space-x-3 px-4 py-2 rounded-lg transition-all duration-200 ${
                currentPage === 'violations' ? 'bg-indigo-600 shadow-md' : 'hover:bg-gray-700'
              }`}
            >
              <Ban className="h-6 w-6" />
              <span className="font-medium">Scanning Violations and ARs</span>
            </button>
            <div className="mt-auto pt-8"> {/* Push logout button to the bottom */}
              <button
                onClick={handleLogout}
                className="flex items-center space-x-3 px-4 py-2 rounded-lg transition-all duration-200 w-full justify-center bg-red-600 hover:bg-red-700"
              >
                <LogOut className="h-6 w-6" />
                <span className="font-medium">Logout</span>
              </button>
            </div>
          </aside>

          {/* Main Content Area */}
          <main className="flex-1 p-8 md:p-10 lg:p-12 overflow-auto">
            {currentPage === 'commission' && <WeeklyCommissionReport weeklyCommissionData={filteredWeeklyCommissionData} agentName={loggedInAgentName} />}
            {currentPage === 'violations' && <ViolationsTracker violationData={filteredViolationAndARData} agentName={loggedInAgentName} />}
          </main>
        </div>
      )}
    </div>
  );
}

export default App;
